Table | Dataset: A dplyr pipeline

parquet_file |&gt;
  read_parquet(as_data_frame = FALSE) |&gt;
  group_by(vendor_name) |&gt;
  summarise(all_trips = n(),
            shared_trips = sum(passenger_count &gt; 1, na.rm = TRUE)) |&gt;
  mutate(pct_shared = shared_trips / all_trips * 100) |&gt;
  collect()

