Join and cross-tabulate

library(tictoc)

tic()
borough_counts &lt;- nyc_taxi |&gt; 
  left_join(pickup) |&gt;
  left_join(dropoff) |&gt;
  count(pickup_borough, dropoff_borough) |&gt;
  arrange(desc(n)) |&gt;
  collect()
toc()

133.705 sec elapsed



2-3 minutes to join twice and cross-tabulate on non-partition variables, with 1.15 billion rows of data 🙂

