Window functions




ProblemSolution 1



How many trips in September 2019 had a longer than average distance for that month?




Option 1 - via DuckDB

nyc_taxi |&gt;
  filter(year == 2019, month == 9) |&gt;
  to_duckdb() |&gt;
  mutate(mean_distance = mean(trip_distance)) |&gt;
  to_arrow() |&gt;
  filter(trip_distance &lt; mean_distance) |&gt;
  count() |&gt;
  collect()

# A tibble: 1 × 1
        n
    &lt;int&gt;
1 4881580




Option 2 - via a join

nyc_taxi |&gt;
  filter(year == 2019, month == 9) |&gt;
  left_join(
    nyc_taxi |&gt;
      filter(year == 2019, month == 9) |&gt;
      group_by(year) |&gt;
      summarise(mean_distance = mean(trip_distance))
    ) |&gt;
  filter(trip_distance &lt; mean_distance) |&gt;
  count() |&gt;
  collect()

